import {
  TextField,
  InputAdornment,
  Icon,
  IconButton,
  Button,
} from "@ui/material";
import "./StartPopup.css";

const StartPopup = ({ onClose }) => {
  return (
    <div className="start-popup">
      <TextField
        className="i-want-to"
        color="primary"
        label="I want to start from"
        sx={{ width: 629 }}
        variant="standard"
      />
      <Button
        className="start-popup-child"
        sx={{ width: 153 }}
        color="primary"
        variant="contained"
      >
        Go
      </Button>
    </div>
  );
};

export default StartPopup;
